import React from 'react';
import '../styles/Profile.css';

function Profile() {
    return (
        <div className="profile-dashboard">
          <ul>
            <li>Dashboard</li>
            <li>Update Account</li>
          </ul>
        </div>
      );
    }

export default Profile;
